$(window).load(function(){$(".se-pre-con").fadeOut("slow")});$(document).ready(function(){$('.pie-title-center').pieChart({barColor:'#10A7AF',trackColor:'#fff',lineCap:'round',lineWidth:8,onStep:function(from,to,percent){$(this.element).find('.pie-value').text(Math.round(percent)+'%')}})});$(document).ready(function(){$("a").on('click',function(event){if(this.hash!==""){event.preventDefault();var hash=this.hash;$('html, body').animate({scrollTop:$(hash).offset().top},800,function(){window.location.hash=hash})}})});$('#print').click(function(){window.print()})